  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  NWR outlines Refuge accomplishments during the 1974 fiscal year. The report begins
  by summarizing the weather conditions and habitat conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, and raptors- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include haying. The public
  relations section of the report describes recreational uses, hunting, and safety.
  N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
